  image: antariksh,
}, {
  name: 'Aishnya Shanvi',
  designation: 'Senior Embedded Dev',
  image: aishanya,
}, {
  name: 'Prateek',
  designation: 'Senior Systems Dev',
  image: prateek,
}, {
  name: 'Pawan Wadhwani',
  designation: 'Senior Systems Dev',
