}, {
  name: 'Anurup Mohanty',
  designation: 'Senior Astrobiologist',
  image: anurup,
}, {
  name: 'Vishal',
  designation: 'Senior Geologist',
  image: vishal,
}, {
  name: 'Anirudh',
  designation: 'Senior Autonomous Dev',
  image: anirudh,
}, {
  name: 'Jordan Fernandez',
  designation: 'Senior Astrobiologist',
  image: jordan,
}, {
  name: 'Reshesh Pathak',
  designation: 'Embedded Dev',
  image: reshesh,
}, {
  name: 'Lokesh Khadim',
  designation: 'Embedded Dev',
  image: lokesh,
}, {
  name: 'Oishwarya Banerjee',
  designation: 'Corporate Manager',
  image: oishwarya,
}, {
  name: 'Mayur Bhosale',
  designation: 'Senior Mechanical Dev',
  image: mayur,
}]
];

export default function TeamPage(props) {
  const classes = useStyles();
  const { ...rest } = props;

  return (
    <div className={classes.container}>
      <div>
        <h1 className={classes.title}>Team 2020</h1>
      </div>
      <div>
        <img className={classes.rover} src={rover2020} />
      </div>
      <TeamContainer profiles={profile[0]} />
    </div>
  );
}
